import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import {
  Button,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  Typography,
} from "@mui/material";

const PatientList = () => {
  const [patients, setPatients] = useState([]);

  useEffect(() => {
    const fetchPatients = async () => {
      try {
        const response = await axios.get("http://localhost:8080/fhir/Patient");
        const entries = response.data.entry || [];
        setPatients(entries.map((entry) => entry.resource));
      } catch (error) {
        console.error("Error fetching patients:", error);
      }
    };

    fetchPatients();
  }, []);

  return (
    <div>
      <Typography variant="h4" gutterBottom>
        Patient List
      </Typography>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Name</TableCell>
            <TableCell>ID Card Number</TableCell>
            <TableCell>Patient ID</TableCell>
            <TableCell>Birth Date</TableCell>
            <TableCell>Gender</TableCell>
            <TableCell>Contact Information</TableCell>
            <TableCell>Diagnostic Information</TableCell>
            <TableCell>Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {patients.map((patient) => (
            <TableRow key={patient.id}>
              <TableCell>
                {patient.name && patient.name.length > 0
                  ? `${patient.name[0].given.join(" ")} ${
                      patient.name[0].family
                    }`
                  : "N/A"}
              </TableCell>
              <TableCell>
                {patient.identifier && patient.identifier.length > 0
                  ? patient.identifier[0].value
                  : "N/A"}
              </TableCell>
              <TableCell>{patient.id}</TableCell>
              <TableCell>{patient.birthDate || "N/A"}</TableCell>
              <TableCell>{patient.gender || "N/A"}</TableCell>
              <TableCell>
                {patient.telecom && patient.telecom.length > 0
                  ? patient.telecom.map((t) => t.value).join(", ")
                  : "N/A"}
              </TableCell>
              <TableCell>
                {/* Diagnostic Information */}
                {patient.extension
                  ? patient.extension.map((ext) => ext.valueString).join(", ")
                  : "N/A"}
              </TableCell>
              <TableCell>
                <Button
                  component={Link}
                  to={`/order/${patient.id}`}
                  variant="contained"
                  color="primary"
                >
                  Create Test Order
                </Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </div>
  );
};

export default PatientList;
